        browser = await puppeteer.launch({
            headless:false,
            args: ['--start-maximized'], // open browser in maxmize window
            devtools:false
         }) 
         const Incognito = await browser.createIncognitoBrowserContext()
        page = await Incognito.newPage(); // open new tab

    })
